import { useState, useEffect } from "react";
import CarCard from "../../components/displayData";
import { useSelector, useDispatch } from "react-redux";
import {
  getCar,
  selectCar,
  selectInitCar,
  filterCar,
  clearCar,
} from "./CariSlice";
import Hero from "../../components/hero";
import Footer from "../../components/displayFooter";

export default function Cari() {
  const [filter, setFilter] = useState({});
  const car = useSelector(selectCar);
  const initCar = useSelector(selectInitCar);
  // const type = [...new Set(initCar.map((e) => e.type))];
  // const transmisi = [...new Set(initCar.map((e) => e.transmission))];
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getCar());
  }, [dispatch]);

  useEffect(() => {
    dispatch(clearCar());
  }, []);

  const handleInputFilter = (type, e) => {
    const val = e.target.value;
    setFilter({ ...filter, [type]: val });
  };

  const handleFilter = () => {
    dispatch(filterCar(filter));
  };

  return (
    <div>
      <Hero />
      <div className="container px-5" style={{ marginTop: "-140px" }}>
        <div className="card shadow">
          <div className="card-body">
            <div className="row mx-2">
              <div className="col-xl-10">
                <div className="row">
                  <div className="col-12 col-sm-12 col-lg-3 col-xl-3">
                    <div className="form-group">
                      <label
                        htmlFor="exampleFormControlSelect1"
                        style={{ fontSize: "14px" }}
                      >
                        Tipe Driver
                      </label>
                      <select
                        className="form-control form-control-sm"
                        id="exampleFormControlSelect1"
                      >
                        <option>Dengan Sopir</option>
                        <option>Tanpa Sopir (Lepas Kunci)</option>
                      </select>
                    </div>
                  </div>
                  <div className="col-12 col-sm-12 col-lg-3 col-xl-3">
                    <div className="form-group">
                      <label
                        htmlFor="exampleFormControlSelect1"
                        style={{ fontSize: "14px" }}
                      >
                        Tanggal
                      </label>
                      <input
                        type="date"
                        className="form-control form-control-sm"
                        id="tanggalSewa"
                        onChange={(e) => handleInputFilter("availableAt", e)}
                      />
                    </div>
                  </div>
                  <div className="col-12 col-sm-12 col-lg-3 col-xl-3">
                    <div className="form-group">
                      <label
                        htmlFor="exampleFormControlSelect1"
                        style={{ fontSize: "14px" }}
                      >
                        Waktu Jemput/Ambil
                      </label>
                      <select
                        className="form-control form-control-sm"
                        id="exampleFormControlSelect1"
                      >
                        <option>08.00 WIB</option>
                        <option>09.00 WIB</option>
                        <option>10.00 WIB</option>
                        <option>11.00 WIB</option>
                        <option>12.00 WIB</option>
                      </select>
                    </div>
                  </div>
                  <div className="col-12 col-sm-12 col-lg-3 col-xl-3">
                    <div className="form-group">
                      <label
                        htmlFor="exampleFormControlSelect1"
                        style={{ fontSize: "14px" }}
                      >
                        Jumlah Penumpang (optional)
                      </label>
                      <input
                        type="number"
                        className="form-control form-control-sm"
                        id="jumlahPenumpang"
                        placeholder="Jumlah Penumpang"
                        onChange={(e) => handleInputFilter("capacity", e)}
                      />
                    </div>
                  </div>
                </div>
              </div>
              <div className="col-xl-2">
                <div className="row">
                  <button
                    type="button"
                    className="btn btn-success mt-3 btn-sm"
                    id="load-btn"
                    onClick={handleFilter}
                  >
                    Cari Mobil
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      <section>
        <div className="container mt-4 px-5">
          <div className="row row-cols-1 row-cols-md-3 g-4" id="cars-container">
            {car ? (
              car.map((item) => <CarCard car={item} key={item.id} />)
            ) : (
              <h1>Tidak ada data</h1>
            )}
          </div>
        </div>
      </section>
      <Footer />
    </div>
  );
}
